function App() {
  useEffect(() => {
    const devTools = window.__REDUX_DEVTOOLS_EXTENSION__;
    if (devTools) {
      // Send initial state
      devTools.connect().init(core.store.getState());
      core.log.info(`Connected to Redux Devtools`);

      // Subscribe to state changes
      core.store.on(/.*/, ({ event, ...payload }) => {
        core.log.info(event, payload);
        devTools.send({ type: event, payload }, core.store.getState(), {
          trace: true,
          name: 'brainstack si-simple',
        });
      });

      return () => {
        devTools.disconnect();
        core.log.info(`Disconnected from Redux Devtools`);
      };
    }
  }, []);

  return (
    <React.Fragment>
      <BrainStackProvider>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Main />}>
              <Route index element={<EventManagement />} />
              {protectedRoutes.map((route, index) => {
                return (
                  <Route
                    path={route.path}
                    element={route.element}
                    key={index}
                  />
                );
              })}
            </Route>
            {publicRoutes.map((route, index) => {
              return (
                <Route path={route.path} element={route.element} key={index} />
              );
            })}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </BrowserRouter>
      </BrainStackProvider>
    </React.Fragment>
  );
}

function Main() {

  const offsets = ["/apps/file-manager", "/apps/email", "/apps/calendar"];
  const { pathname } = useLocation();
  const bc = document.body.classList;

  // set sidebar to offset
  (offsets.includes(pathname)) ? bc.add("sidebar-offset") : bc.remove("sidebar-offset");

  // auto close sidebar when switching pages in mobile
  bc.remove("sidebar-show");

  // scroll to top when switching pages
  window.scrollTo(0, 0);

  return (
    <React.Fragment>
      <Sidebar />
      <Outlet />
    </React.Fragment>
  )
}

